function BPImportToClipboard(){var a=JSON.stringify({template:rootActivity.Serialize(),parameters:arWorkflowParameters,variables:arWorkflowVariables,constants:arWorkflowConstants});BX.clipboard.copy(encodeURIComponent(a))}function BPExportFromString(a){try{var t=JSON.parse(decodeURIComponent(a))}catch(a){t={}}if(t.parameters&&BX.type.isPlainObject(t.parameters)){arWorkflowParameters=t.parameters}if(t.variables&&BX.type.isPlainObject(t.variables)){arWorkflowVariables=t.variables}if(t.constants&&BX.type.isPlainObject(t.constants)){arWorkflowConstants=t.constants}if(t.template&&BX.type.isPlainObject(t.template)){arWorkflowTemplate=t.template;ReDraw()}}